The `Headers` interface of the Fetch APIallows you to perform various actions on HTTP request and response headers. These actions include retrieving, setting, adding to, and removing. A `Headers` object has an associated header list, which is initially empty and consistsof zero or more name and value pairs. You can add to this using methods like `append()` (see Examples.)In all methods of this interface, header names are matched by case-insensitive byte sequence.

