isLittleEndian.expr:
(function() ->  @:implicitReturn return {
	var a8 = new js.lib.Uint8Array(4);
	var a32 = (new js.lib.Uint32Array(a8.buffer)[0] = 0xFFcc0011);
	return !(a8[0] == 0xff);
})()

m.e:
(function() ->  @:implicitReturn return {
	var a8 = new js.lib.Uint8Array(4);
	var a32 = (new js.lib.Uint32Array(a8.buffer)[0] = 0xFFcc0011);
	return !(a8[0] == 0xff);
})()

